(17, 1, '2020-10-26 10:19:17', '2020-10-26 10:19:17', '<!-- wp:paragraph -->\n<p>The history of political blogging might usefully be divided into the periods pre- and post-Huffington. Before the millionaire socialite Arianna Huffington decided to get in on the act, bloggers operated in a spirit of underdog solidarity. They hated the mainstream media - and the feeling was mutual.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=eiPXa-oTixs\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=eiPXa-oTixs\n</div></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'The Huffington Post', '', 'publish', 'open', 'open', '', 'the-huffington-post', '', '', '2020-10-28 15:33:25', '2020-10-28 15:33:25', '', 0, 'http://localhost/wordpress/?p=17', 0, 'post', '', 0),
