(36, 1, '2020-10-26 11:08:38', '2020-10-26 11:08:38', '<!-- wp:image {\"align\":\"left\",\"id\":37,\"width\":318,\"height\":160,\"sizeSlug\":\"large\"} -->\n<div class=\"wp-block-image\"><figure class=\"alignleft size-large is-resized\"><img src=\"http://localhost/wordpress/wp-content/uploads/2020/10/Capture1-1024x515.png\" alt=\"\" class=\"wp-image-37\" width=\"318\" height=\"160\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"align\":\"left\"} -->\n<p class=\"has-text-align-left\">Techcrunch began in 2005 as a blog about dotcom start-ups in Silicon Valley, but has quickly become one of the most influential news websites across the entire technology industry. Founder Michael Arrington had lived through the internet goldrush as a lawyer and entrepreneur before deciding that writing about new companies was more of an opportunity than starting them himself.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column {\"width\":33.33} -->\n<div class=\"wp-block-column\" style=\"flex-basis:33.33%\"><!-- wp:paragraph -->\n<p>This is Siddhesh Chourasia here.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column {\"width\":66.66} -->\n<div class=\"wp-block-column\" style=\"flex-basis:66.66%\"><!-- wp:paragraph -->\n<p>I\'m living in Pune. I have done my engineering from SPPU, one of the renowned university of India.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', 'Techcrunch', '', 'publish', 'open', 'open', '', 'techcrunch', '', '', '2020-10-26 11:08:38', '2020-10-26 11:08:38', '', 0, 'http://localhost/wordpress/?p=36', 0, 'post', '', 0),
