(89, 1, '2021-02-19 11:41:14', '2021-02-19 11:41:14', '<!-- wp:paragraph -->\n<p><em><strong>Digital Fortress</strong></em>is a<a href=\"https://en.wikipedia.org/wiki/Techno-thriller\">techno-thriller</a>novel written by American author<a href=\"https://en.wikipedia.org/wiki/Dan_Brown\">Dan Brown</a>and published in 1998 by<a href=\"https://en.wikipedia.org/wiki/St._Martin%27s_Press\">St. Martin\'s Press</a>. The book explores the theme of government surveillance of electronically stored information on the private lives of citizens, and the possible<a href=\"https://en.wikipedia.org/wiki/Civil_liberties\">civil liberties</a>and ethical implications of using such technology.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":88,\"sizeSlug\":\"large\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://localhost/wordpress/wp-content/uploads/2021/02/breadcrum-1024x683.jpg\" alt=\"\" class=\"wp-image-88\"/><figcaption><strong>My Workspace</strong></figcaption></figure>\n<!-- /wp:image -->', 'Digital Fortress', '', 'inherit', 'closed', 'closed', '', '87-revision-v1', '', '', '2021-02-19 11:41:14', '2021-02-19 11:41:14', '', 87, 'http://localhost/wordpress/2021/02/19/87-revision-v1/', 0, 'revision', '', 0),
